import React from 'react';
import styled from 'styled-components';

const Div = styled.div`
    display: flex;
    flex-direction: column;
    justify-content: space-between;
    text-align: center;
    line-height: 5px;
    font-size: 20px;

`

const Category = () => {
    return (
        <Div>
            <span>장르</span>
            <span>등급</span>
            <span>제작사</span>
            <span>평점</span>
        </Div>
    );
};

export default Category;
